import styled from 'styled-components';
import HomeComponent from './Components/HomeComponent';

const Container = styled.div`
display: flex;
flex-direction: column;
align-items: center;
margin: 30px 0 10px;
width: 100%;
`;

const Header = styled.span`
color: black;
font-size: 25px;
font-weight: bold;
`;

const App = () => {
  return (
    <Container>
      <Header>Expense Tracker</Header>
      <HomeComponent />
    </Container>
  );
}

export default App;
